DROP TABLE IF EXISTS `field_coordinate`;
CREATE TABLE `field_coordinate` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order` int(11) NOT NULL DEFAULT '0' COMMENT '排序(预留字段)',
  `table_name` varchar(128) CHARACTER SET utf8 NOT NULL COMMENT '表名',
  `code` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '字段编码',
  `code_name` varchar(128) CHARACTER SET utf8 NOT NULL COMMENT '字段名称',
  `abscissa` int(11) NOT NULL COMMENT '横坐标',
  `ordinate` int(11) NOT NULL COMMENT '纵坐标',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `font_name` varchar(60) CHARACTER SET utf8 NOT NULL DEFAULT '新宋体' COMMENT '字体类型',
  `font_size` int(11) NOT NULL DEFAULT '12' COMMENT '字体大小',
  `del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否使用(0-使用 1-不适用)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=111 DEFAULT CHARSET=latin1;

