-- ----------------------------
-- Table structure for r_change
-- ----------------------------
DROP TABLE IF EXISTS `r_change`;
CREATE TABLE `r_change` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `r_name` varchar(128) CHARACTER SET utf8 NOT NULL COMMENT '片区项目名称',
  `r_number` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '房号',
  `r_ridgepole` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '栋',
  `r_unit` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '单元',
  `r_floor` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '楼层',
  `r_mark` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '房号',
  `r_area` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '面积',
  `r_unit_price` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '单价',
  `r_total_price` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '总价',
  `r_choose_people` varchar(128) CHARACTER SET utf8 DEFAULT NULL COMMENT '点房人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `r_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除 0-未删除 1-删除',
  `assigned_project` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '分配项目',
  `housing_platform` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '房源平台',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of r_change
-- ----------------------------

-- ----------------------------
-- Table structure for t_area
-- ----------------------------
DROP TABLE IF EXISTS `t_area`;
CREATE TABLE `t_area` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '片区名称',
  `status` int(11) DEFAULT NULL COMMENT '状态：0启用、1禁用',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人员',
  `modified_date` datetime DEFAULT NULL COMMENT '修改时间',
  `modified_user_id` bigint(20) DEFAULT NULL COMMENT '修改人员',
  `deleted` tinyint(255) DEFAULT NULL COMMENT '逻辑删除标识',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='片区维护';

-- ----------------------------
-- Records of t_area
-- ----------------------------

